pragma solidity >=0.4.21 <0.7.0;
contract BITS {

	struct student {
		uint id;
		string name;
		string DOB;
		string highest_qualification;
		string student_type;
		bool completed;
	}

	struct Faculty {
		uint id;
		string name;
		string addr;
		string email;
		string password;
		string telephone;
		string department;
		string subject;
	}

	mapping(uint => Faculty) public faculties;
	mapping(uint => student) public students;
	uint public faculty_count = 0;
	uint public student_count = 0;

	event studentCreated(
		uint id,
		string name,
		string DOB,
		string highest_qualification,
		string student_type,
		bool completed
	);
	event facultyCreated(
		uint id,
		string name,
		string addr,
		string email,
		string password,
		string telephone,
		string department,
		string subject
	);
	event TaskCompleted(
    	uint id,
    	bool completed
  	);
	constructor() public {
		add_faculty("Faculty", "Embedded", "OS", "f", "a", "r", "er");
		


	}

	function add_faculty(string memory _name, string memory _addr, string memory _email, string memory _password, string memory _telephone, string memory _department, string memory _subject) public {
		faculty_count++;
		faculties[faculty_count] = Faculty(faculty_count, _name, _addr, _email, _password, _telephone, _department, _subject);
		emit facultyCreated(faculty_count, _name, _addr, _email, _password, _telephone, _department, _subject);
	}
	function add_student(string memory _name, string memory _DOB, string memory _highest_qualification, string memory _student_type) public {
		student_count++;
		students[student_count] = student(student_count, _name, _DOB, _highest_qualification, _student_type, false);
		emit studentCreated(student_count, _name, _DOB, _highest_qualification, _student_type, false);
	}
	
}
